import math
import time
# 카라츠바 알고리즘
# 시간 복잡도 O(n^log3)
threshold = 32

def Karatsuba(u: int, v: int):
    n = max(len(str(u)), len(str(v)))
    global threshold
    if u == 0 or v == 0:
        return 0
    elif n<=threshold:
        return u*v
    else:
        m = n // 2
        x, y = u // (10 ** m), u % (10 ** m)
        w, z = v // (10 ** m), v % (10 ** m)
        r = Karatsuba(x + y, w + z)
        p = Karatsuba(x, w)
        q = Karatsuba(y, z)
        return p * (10 ** (2 * m)) + (r - p - q) * (10 ** m) + q


